      <script>
          // dump node graph
          function createJSON() {
              var traverse = function(json, scene, containerName) {
                  var isMultiField, fieldName;

                  json[containerName] = {};

                  for (fieldName in scene._vf) {
                      if (scene._vfFieldTypes[fieldName] === undefined)
                          continue;

                      isMultiField = (scene._vfFieldTypes[fieldName].charAt(0) == "M");
                      var fieldValue = isMultiField ? "[" : "";

                      if (scene._vf[fieldName].toGL)
                          fieldValue += scene._vf[fieldName].toGL().toString();
                      else if (scene._vfFieldTypes[fieldName] == "MFString") {
                          for (var k = 0; k < scene._vf[fieldName].length; k++)
                              if (k == scene._vf[fieldName].length - 1)
                                  fieldValue += scene._vf[fieldName][k];
                              else
                                  fieldValue += (scene._vf[fieldName][k] + ", ");
                      }
                      else
                          fieldValue += scene._vf[fieldName].toString();

                      fieldValue += (isMultiField ? "]" : "");
                      if (fieldValue.length == 0)
                          fieldValue = "";

                      json[containerName][fieldName] = fieldValue;
                  }

                  for (fieldName in scene._cf) {
                      isMultiField = (scene._cfFieldTypes[fieldName].charAt(0) == "M");
                      if (isMultiField) {
                          json[containerName][fieldName] = [];

                          for (var cnt=0; cnt<scene._cf[fieldName].nodes.length; cnt++) {
                              json[containerName][fieldName][cnt] = {};
                              traverse(json[containerName][fieldName][cnt],
                                       scene._cf[fieldName].nodes[cnt],
                                       scene._cf[fieldName].nodes[cnt].typeName());
                          }
                      }
                      else {
                          json[containerName][fieldName] = {};
                          if (scene._cf[fieldName].node)
                              traverse(json[containerName][fieldName],
                                       scene._cf[fieldName].node,
                                       scene._cf[fieldName].node.typeName());
                          else
                              json[containerName][fieldName] = null;
                      }
                  }

                  // Note: routes are currently missing, since they are no objects (see X3DNode.js)
                  // and maybe exchange typeName against containerFieldName for spec conformance?
              };

              var scene = document.getElementById('x3dElement').runtime.canvas.doc._scene;
              var tree = {};

              traverse(tree, scene, scene.typeName());

              // debug
              var out = document.getElementById("stringifiedDump");
              out.innerHTML = "<p>JSON is also dumped as object to console!<br></p><p>" +
                              JSON.stringify(tree, null, " ") + "</p>";
              out.style.display = "block";
              //

              return tree;
          }
      </script>
